  false,\n\t\"url\": null,\n\t\"notes\": \"The Terrestrial Environmental Observation
  Network (TEON) is an effort to establish a sustainable environmental observing network
  of northern Alaska. TEON will focus work in watersheds that collectively represent
  the diversity of landscape settings at the ecoregional scale, take advantage of
  existing science infrastructure and logistics capacity, and provide opportunities
  to build on existing long-term data sets. Candidate watersheds for TEON include
  Agashashok River, Barrow/Meade River, Fish/Judy Creek, Hulahula/Jago River, Kokolik
  River, Kuparuk River, and Upper Koyukuk River.\",\n\t\"license_title\": null,\n\t\"extras\":
